syntax = "proto2";

package MMPro.micromsg;

import "BaseRequest.proto";
import "SKBuiltinBuffer_t.proto";

message UploadHDHeadImgRequest {
	required BaseRequest _BaseRequest = 1;
	required uint32 _TotalLen = 2;
	required uint32 _StartPos = 3;
	required uint32 _HeadImgType = 4;
	required SKBuiltinBuffer_t _Data = 5;
	optional string _ImgHash = 6;
	optional string _UserName = 7;
}
